import rbyImg from "./pokemon_rby_min.webp";
import gscImg from "./pokemon_gsc3.webp";
import rseImg from "./pokemon_rse2.webp";
import dpImg from "./pokemon_dp_4.webp";
import bwImg from "./pokemonbw8_4.webp";
import xyImg from "./pokemon_xy_0.webp";
import smImg from "./pokemon_sm.webp";
import swshImg from "./pokemon_sword__shield.webp";
import svImg from "./pokemon_sv.jpg";

const generationImg = {
  "generation-i": rbyImg,
  "generation-ii": gscImg,
  "generation-iii": rseImg,
  "generation-iv": dpImg,
  "generation-v": bwImg,
  "generation-vi": xyImg,
  "generation-vii": smImg,
  "generation-viii": swshImg,
  "generation-ix": svImg,
};

export default generationImg;
